import * as React from 'react'
import {Fragment} from 'react'
import MainContainer from './navigation/MainContainer';
import BottomNav from './navigation/BottomNav';



function App() {
  return (
      <Fragment>
        <MainContainer/>
        <BottomNav/>

      </Fragment> 
  );
}

export default App;
